import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Card from '../../components/Card/Card.jsx';

const useStyles = makeStyles((theme) => ({
  cards: {
    marginTop: '150px',
    justify: 'space-around',
  },
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

function Home() {
  const classes = useStyles();
  const [users, setUsers] = useState([1, 2, 3]);
  return (<>
    <Grid container spacing={3} justify="center" className={classes.pap}>
      <Grid item xs={3}>
        <Paper className={classes.paper}>text</Paper>
      </Grid>
      <Grid item xs={3}>
        <Paper className={classes.paper}>text</Paper>
      </Grid>
      <Grid item xs={3}>
        <Paper className={classes.paper}>text</Paper>
      </Grid>
    </Grid>
    <Grid container spacing={3} jjustify="center" className={classes.cards}>
      {users.map((user) => (
        <Grid key={user} item xs={12} sm={6} lg={4}>
          <Card imgUrl="https://themicon.co/theme/centric/v2.0/static-html5/src/images/04.jpg" />
        </Grid>
      ))}
    </Grid></>
  );
}

export default Home;
